import React, { useState, useCallback } from "react";
import styled from "styled-components";
import Spacer from "../../Spacer";
import { useTranslation } from "react-i18next";
const Nav: React.FC = () => {
  return (
    <div className="wing-blank-lg ">
      <div className="bd-bottom">
        <StyledBarItem className="flex-jc-start">
          <img src={require("../../../assets/img/home_icon.png")} alt=""  width="40"/>
          首页
        </StyledBarItem>
        <StyledBarItem className="flex-jc-start">
          <img src={require("../../../assets/img/coin_icon.png")} alt="" />
          铸币
        </StyledBarItem>
        <StyledBarItem className="flex-jc-start">
          <img src={require("../../../assets/img/exchange_icon.png")} alt="" />
          兑换
        </StyledBarItem>
        <StyledBarItem className="flex-jc-start">
          <img src={require("../../../assets/img/pool_icon.png")} alt="" />
          保险池
        </StyledBarItem>
        <StyledBarItem className="flex-jc-start">
          <img src={require("../../../assets/img/mine_icon.png")} alt="" />
          挖矿
        </StyledBarItem>
      </div>
    </div>
  );
};

const StyledBarItem = styled.div`
  color: ${(props) => props.theme.color.grey[300]};
  padding-top: 10px;
`;

export default Nav;
